import React from 'react';
import ReactDOM from 'react-dom';




const FunctionComponents = (props) => < h1 id = "hi" > {
  props.text
} < /h1>;

const Element = < p > Параграф < /p>;

class Main extends React.Component {
  render() {
    return ( <
      div className = "main" >
      <
      Header text = {
        'свойство текст'
      }
      /> <
      Element / > ; <
      /div>
    )
  }
}

ReactDOM.render( <
  React.StrictMode >
  <
  Main / >
  <
  /React.StrictMode>,
  document.getElementById('root')
);
